import React from "react";
import EmpData from "./EmpData";
import "./Emp.css";

const Emp = () => {
  console.log(EmpData);
  return (
    <>
      <div className="table-data">
        {EmpData.map((elem) => {
          let { id, fname, lname, age, job, salary } = elem;
          return (
            <table border={1} cellPadding={20} cellSpacing={3}>
              <tr>
                <th>{id}</th>
                <th>{fname}</th>
                <th>{lname}</th>
                <th>{age}</th>
                <th>{job}</th>
                <th>{salary}</th>
              </tr>
            </table>
          );
        })}
      </div>
    </>
  );
};

export default Emp;
